            border: 'black 1px solid',
            minWidth: '160px',
            boxShadow: '0px 8px 16px 0px rgba(0,0,0,0.2)',
            zIndex: 1
        };

        return <div style={divStyle}>TEST</div>
    }
}

export default UserMenu;
